INSERT INTO VideoGames (VideoGameId,Name,Description,ReleaseDate,Stock,ImageUrl,Popularity,Desarrollador,Price,GenreId) VALUES ('1','The Last of Us 1','The Last of Us Part 1 es un videojuego de terror de acción y aventura de disparos en tercera persona de 2013 desarrollado por Naughty Dog y publicado por Sony Interactive Entertainment.','10/9/2013 12:00:00 AM','0','\images\3c306592-866c-4161-af53-97268d7c600d.jfif','10','Naughty Dog','30.99','1');
INSERT INTO VideoGames (VideoGameId,Name,Description,ReleaseDate,Stock,ImageUrl,Popularity,Desarrollador,Price,GenreId) VALUES ('2','God of War','God of War es una franquicia de videojuegos de acción y aventura creada por David Jaffe desarrollada por Santa Monica Studio de Sony. Comenzó en 2005 en la consola de videojuegos PlayStation 2 y se ha convertido en una serie insignia para PlayStation, compuesta por nueve entregas en múltiples plataformas.','1/1/2018 12:00:00 AM','7','\images\df7d1a29-49c2-47f9-b68f-7cf1621fc071.webp','16','Santa Monica Studio','45.50','4');
INSERT INTO VideoGames (VideoGameId,Name,Description,ReleaseDate,Stock,ImageUrl,Popularity,Desarrollador,Price,GenreId) VALUES ('3','Ghost of tsushima','Ghost of Tsushima es un videojuego de acción-aventura desarrollado por Sucker Punch Productions y publicado por Sony Interactive Entertainment para PlayStation 4 y PlayStation 5.','6/9/2021 12:00:00 AM','0','\images\cb8726f7-4ea0-42d5-85a9-4d82726d3e6d.webp','7','Punch Productions','67.89','2');
INSERT INTO VideoGames (VideoGameId,Name,Description,ReleaseDate,Stock,ImageUrl,Popularity,Desarrollador,Price,GenreId) VALUES ('4','The witcher 3','The Witcher 3: Wild Hunt es un videojuego de rol desarrollado y publicado por la compañía polaca CD Projekt RED. Esta compañía es la desarrolladora mientras que la distribución corre a cargo de la Warner Bros. Interactive, en el caso de Norteamérica y Bandai Namco para Europa.','1/5/2015 12:00:00 AM','0','\images\198aec7c-0f21-46d7-9289-c7c387e17acc.webp','14','CD Projekt RED','25.55','4');
INSERT INTO VideoGames (VideoGameId,Name,Description,ReleaseDate,Stock,ImageUrl,Popularity,Desarrollador,Price,GenreId) VALUES ('5','Horizon Zero Down','Horizon Zero Dawn es un videojuego de acción, aventura y de mundo abierto desarrollado por Guerrilla Games y distribuido por Sony Interactive Entertainment para PlayStation 4 y Microsoft Windows.','7/23/2019 12:00:00 AM','10','\images\a4f5e324-d9a4-43a4-934e-c2d6d10c3751.jpg','9','Guerrilla Games','43.23','4');
INSERT INTO VideoGames (VideoGameId,Name,Description,ReleaseDate,Stock,ImageUrl,Popularity,Desarrollador,Price,GenreId) VALUES ('6','Read Dead Redemption 2','Red Dead Redemption 2 es un videojuego de acción-aventura de mundo abierto desarrollado y publicado por Rockstar Games. El juego es la tercera entrada de la serie Red Dead y una precuela del juego Red Dead Redemption de 2010.','5/23/2018 12:00:00 AM','1','\images\1610dabd-625a-417c-9494-5a438c5412b1.jpg','11','Rockstar','60.27','4');
INSERT INTO VideoGames (VideoGameId,Name,Description,ReleaseDate,Stock,ImageUrl,Popularity,Desarrollador,Price,GenreId) VALUES ('7','Dota 2','Dota 2 (En español Defensa de los Ancestros 2) es un videojuego perteneciente al género de Arena de batalla en línea ARTS («estrategia de acción en tiempo real»), también conocido en inglés como MOBA, fue lanzado el 9 de julio del año 2013. El juego fue desarrollado por la empresa Valve Corporation.','7/9/2013 12:00:00 AM','0','\images\e1504044-ffd7-4945-8a0e-65f8b475ad09.jpg','0','Valve','10.99','3');
INSERT INTO VideoGames (VideoGameId,Name,Description,ReleaseDate,Stock,ImageUrl,Popularity,Desarrollador,Price,GenreId) VALUES ('8','Star Wars Jedi: La Orden caída ','Star Wars Jedi: Fallen Order, traducido en algunas tiendas digitales como Star Wars Jedi: La Orden caída, es un videojuego de acción y aventura para un solo jugador desarrollado por Respawn Entertainment y publicado por Electronic Arts, ambientado en el universo de Star Wars.','8/6/2022 12:00:00 AM','28','\images\596d23a0-eebc-41d2-9b1b-423f38617231.webp','6','EA','56.23','4');
INSERT INTO VideoGames (VideoGameId,Name,Description,ReleaseDate,Stock,ImageUrl,Popularity,Desarrollador,Price,GenreId) VALUES ('9','Clash of clans','Clash of Clans, también conocido como CoC, es un videojuego de estrategia y de construcción de aldeas en línea, para dispositivos móviles con plataformas de iOS y Android. Fue desarrollado por Supercell y lanzado para dispositivos iOS el 2 de agosto del 2012, y el 8 de octubre para dispositivos Android.​','8/2/2012 12:00:00 AM','5','\images\9cf26be6-6377-4985-b018-229de785d9eb.png','0','Supercell','5.22','3');
INSERT INTO VideoGames (VideoGameId,Name,Description,ReleaseDate,Stock,ImageUrl,Popularity,Desarrollador,Price,GenreId) VALUES ('10','Assassin''s Creed Shadows','Assassin''s Creed Shadows es un próximo videojuego de rol de acción desarrollado por Ubisoft Quebec y publicado por Ubisoft, que se lanzará el 20 de marzo de 2025 para PlayStation 5, PlayStation 4, Windows, macOS y Xbox Series X/S.','3/20/2025 12:00:00 AM','13','\images\26ccf0eb-800f-4876-b7a8-735604f801e8.webp','0','Ubisoft','66.21','1');
